import React from "react";
import "../styles/Projects.css";

function Projects() {
  return (
    <section className="projects">
      <h2>Projects</h2>
      <div className="project-grid">
        <div className="project-card">
          <h3> Khareedgar</h3>
          <p>A Next.js based website which is an ecommerce site   with animations and modern layout.</p>
        </div>
        <div className="project-card">
          <h3>Chicken Store</h3>
          <p>E-commerce site for fresh poultry, built with Next.js.</p>
        </div>
        <div className="project-card">
          <h3>Cyber Attack Simulator</h3>
          <p>Terminal-style dashboard with Matrix rain animation.</p>
        </div>
      </div>
    </section>
  );
}

export default Projects;
